import {Route, BrowserRouter as Router, Switch} from "react-router-dom";
import Pages from "../Pages";

const MountRoutes = () => {
	const routes = {
		"/": Pages.MainPage,
		"/main-page": Pages.MainPage,
		"/status": Pages.Status,
		"/task/add": Pages.AddNewTask,
	}

	return [
		...Object.entries(routes).map(([path, component]) =>
			<Route
				exact
				path={path}
				component={component}
				key={path}
			/>
		)
	];
}

const Routes = () => (
	<Router basename={"/"}>
		<Switch>
			{MountRoutes()}
		</Switch>
	</Router>
);

export default Routes;
